                    <Protected component={() => {
                        return <Product name="sana safinaz-kid-shirt_pant" />
                    }} /></Route>
                {/* **************************Sana Safinaz end here*********************** */}



                {/* *******************Maria.B start************************* */}
                <Route exact path='/mariab-female_westren'>
